        k=0
        while i<len(sol) and j<len(sag):
            if sol[i]<sag[j]:
                SiralanmisDizi[k]=sol[i]
                i = i +1
            else:
                SiralanmisDizi[k] = sag[j]
                j = j + 1
            k = k + 1
